import React from 'react';
import { Link } from 'react-router-dom';
import { FaCog, FaComments, FaSignOutAlt } from 'react-icons/fa';
import '../../styles/user-nav.css';
import LogoutButton from './Logout';

function Sidebar() {
  return (
    <div className="sidebar">
      <ul>
        <li className='path'>
          <Link to="/settings">
            <FaCog /> Settings
          </Link>
        </li>
        <li className='path'>
          <Link to="/feedback">
            <FaComments /> Feedback
          </Link>
        </li>
        <li className='path'>
          <Link to="">
            <LogoutButton/> Logout
          </Link>
        </li>
      </ul>
    </div>
  );
}

export default Sidebar;
